package com.model;

public class SaltoDistancia {

	private int idade;
	private int fraco;
	private int razoavel;
	private int bom;
	private int muitoBom;
	public char Tipo;
	
	public SaltoDistancia() {
		// TODO Auto-generated constructor stub
	}
	

	public int getIdade() {
		return idade;
	}

	public void setIdade(int idade) {
		this.idade = idade;
	}

	public int getFraco() {
		return fraco;
	}

	public void setFraco(int fraco) {
		this.fraco = fraco;
	}

	public int getRazoavel() {
		return razoavel;
	}

	public void setRazoavel(int razoavel) {
		this.razoavel = razoavel;
	}

	public int getBom() {
		return bom;
	}

	public void setBom(int bom) {
		this.bom = bom;
	}

	public int getMuitoBom() {
		return muitoBom;
	}

	public void setMuitoBom(int muitoBom) {
		this.muitoBom = muitoBom;
	}


	public char getTipo() {
		return Tipo;
	}


	public void setTipo(char tipo) {
		Tipo = tipo;
	}


}
